import React,{Component} from 'react'
import './App.css';
import stateVideo from './stateVideo'
import Nav from './component/Nav'
import ListVideo from './component/ListVideo'


class App extends Component{

  state={
    video:stateVideo
  }


  render(){
    const allVideo=Object.keys(this.state.video)
              .map(key => <option key={this.state.video[key].nom} value={this.state.video[key].nom} />)
    return (
      <>
        <Nav allTitleVideo={allVideo}></Nav>
        <ListVideo state/>
      </>
    );
  }
}

export default App;
